(17, ' African IMPACT LEADERSHIP AWARD', '<p>African Impact Leadership Award of the year is being conceptualized to be a widely recognized accolade a person can receive in Africa. It was designed to afford the people of the continent with the occasion to pay tribute to individuals who have made a real and valuable contribution to our society. The Awards are considered not just to give public recognition to those who in their way, have made such a positive impact on Africa, but whose public and private comportments typify the ethos of OMOLUABI (An African value)&nbsp;<br>Therefore, the Award recognizes a unique range of indigenes of African Ancestry â€“ from unsung heroes who have quietly made a difference and enhanced the lives of others in communities, to the household names who have made a real difference to peopleâ€™s lives on national and international level.<br>This yearâ€™s event will provide a platform to celebrate the continentâ€™s pillars of hope â€“ business, political and diplomatic leaders who are helping us to see the light pf possibilities in the midst of a global pandemic that has become an existential threat.</p><p><br>Credibility of the award</p><p>The African Impact Leadership Award is Africaâ€™s vote-based endorsement, meant for Africans who have been seriously involved in the transformation of the society. Our screening committee unanimously resolved that the Persons of the year must be personalities who have deliberately shown much commitment to Africaâ€™s re-building process, youth empowerment, and &nbsp;have been involved in frame-work for continentâ€™s economic recovery and have recorded uncommon feat in their chosen business and career.<br>The abuse to which awards have been put in our polity, at all level is worrisome. No matter what, the value of an award does not lie in itself but in the transparency and credibility of the award process and the general acceptance of such award as deserving. In realization of this, various committees have been put in place to collate the nominations through an online poll conducted by the organizing committee. The committee will in-turn present the nominees for an online poll via our e-voting system where winners and runner-up for each category will emerge for the prestigious award</p><p>Who we are:</p><p>African IMPACT Magazine is one of the Africaâ€™s new generation empowered public relations outfit with a Mission: To build Africaâ€™s foremost Public Relations and Event Management Organization with a network of worldâ€™s best policy advocacy team propelling the frontiers of Africaâ€™s advancement. We offer full-service public relations and communications strategy programs &nbsp;to clients from our office in Accra-Ghana and Abuja-Nigeria. We can reach into the African continent through our sound-footing network and affiliation to IPRC strategies which is part of the AIM group which cut across the African continent.<br>We offer a mix of communications experience and expertise spanning the business, corporate and public sector and civil society</p><p><br>Our products/services<br>Â· Public Relations, Publishers of African IMPACT Magazine, the IMPACT specials etc, Event Management, Reputation Management, Stakeholder management, Conferences and Awards</p>', '2', 'a:13:{s:28:\"QUZSSUNBTiBMRUdBQ1kgQVdBUkQg\";a:2:{s:2:\"id\";s:28:\"QUZSSUNBTiBMRUdBQ1kgQVdBUkQg\";s:8:\"category\";s:21:\"AFRICAN LEGACY AWARD \";}s:60:\"QUZSSUNBTiBDSElFRiBFWEVDVVRJVkUgT0ZGSUNFUiBPRiBUSEUgWUVBUg==\";a:2:{s:2:\"id\";s:60:\"QUZSSUNBTiBDSElFRiBFWEVDVVRJVkUgT0ZGSUNFUiBPRiBUSEUgWUVBUg==\";s:8:\"category\";s:43:\"AFRICAN CHIEF EXECUTIVE OFFICER OF THE YEAR\";}s:32:\"QUZSSUNBTiBPRiBUSEUgWUVBUiAyMDIw\";a:2:{s:2:\"id\";s:32:\"QUZSSUNBTiBPRiBUSEUgWUVBUiAyMDIw\";s:8:\"category\";s:24:\"AFRICAN OF THE YEAR 2020\";}s:44:\"QUZSSUNBTiBZT1VORyBMRUFERVIgT0YgVEhFIFlFQVI=\";a:2:{s:2:\"id\";s:44:\"QUZSSUNBTiBZT1VORyBMRUFERVIgT0YgVEhFIFlFQVI=\";s:8:\"category\";s:32:\"AFRICAN YOUNG LEADER OF THE YEAR\";}s:48:\"QUZS